function pixflow_iconShortcode(id){"use strict";var $=jQuery;$("."+id+" img.svg").each(function(){var $img=$(this);var imgID=$img.attr("id");var imgClass=$img.attr("class");var imgURL=$img.attr("src");$.ajax({url:imgURL,processData:false,dataType:"html"}).done(function(data){var $svg=$(data).find("svg");if(!$svg.length){$svg=$(data)}if(typeof imgID!=="undefined"){$svg=$svg.attr("id",imgID)}if(typeof imgClass!=="undefined"){if($svg.attr("class")!=undefined)var classes=$svg.attr("class");else{for(var i=0;i<$svg.length;i++){if($svg.get(i).getAttribute&&$svg.get(i).getAttribute("class")!=undefined){var classes=$svg.get(i).getAttribute("class");break}}}$svg=$svg.attr("class",classes+" "+imgClass+" replaced-svg")}$svg=$svg.removeAttr("xmlns:a");$img.replaceWith($svg);if(typeof pixflow_animateSvgInitiate=="function"){pixflow_animateSvgInitiate()}if(typeof pixflow_animateSvgExecute=="function"){pixflow_animateSvgExecute()}})})}